import React from "react";
import HeroSelection from "./HeroSelection"
import RecruitList from "./RecruitList"



function Home({ isLoadedImages, apodArray, displayArray, apodSelectionArray, onAddToProfileBtnClick, onDisselectBtnClickInSelection, apodArrayParse, setApodArrayParse, currentProfile, nasaImage }) {


  return (
    <div className="HomeContainer">
      {
        heroSelectionArray.length === 0 ?
        <h1 className="home-h2">Please start selecting your heroes </h1>
        :



        <HeroSelection apodSelectionArray={apodSelectionArray}
                       onAddToProfileBtnClick={onAddToProfileBtnClick}
                       onDisselectBtnClickInSelection={onDisselectBtnClickInSelection}
                       currentProfile={currentProfile}

                        />

      }

        <RecruitList isLoadedImages={isLoadedImages} apodArray={apodArray} apodArrayParse={apodArrayParse} setApodArrayParse={setApodArrayParse} nasaImage={nasaImage}/>

    </div>
  );
}

export default Home;
